        uint256 startSecs;
        uint256 interestRate;
        uint16 toChainId;
    }

    function borrow(
        uint16 toChainId,
        bytes32 tokenIn,
        bytes32 tokenOut,
        uint256 value,
        bytes32 receiver
    ) external payable returns (bytes32);

